int lengthOfLongestSubstring(char* s) 
{
    int ret = 0;
    char *p = s;
    int l = strlen(s);
    printf("length of %s is %d\n", s, l);
    int i = l;
    i = i > 96? 96: i;
    for(; i > 0; --i) {
        printf("%d !!!\n", i);
        int en = 0;
        p = s;
        while(*(p+i-1)) {
            if(check_str(p, i) == 0) {
                
                en = 1;
                break;
            }
            ++p;
        }
        
        if(en == 1) {
            return i;
        }
    }
    return 0;
}
    
    
